import React from "react";
import Box from '@mui/material/Box';
import zIndex from "@mui/material/styles/zIndex";
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';

function Signin(){

    return(

        <Box
      sx={{
        width: 850,
        height: 350,
        position:'relative',
        left:400,
        top:250,
        display:'flex',
        flexDirection:'row',
        border:'2px solid red'
         }}>
             <Box sx={{
                    width:'60%',
                    height:'80%',
                    borderRadius:4,
                    position:'relative',
                    top:40,
                    zIndex:0,
                    background:'#F5F5F5'



             }}>
                 <Avatar

                    src="../signin/signin1.jpg"
                    sx={{ width: 300, height: '70%',position:'relative',left:40 }}
                 />
                 <Typography sx={{position:'relative',
                 right:30}}
                 ><h2>ONLINE BOOK SHOPPING</h2></Typography>

             </Box>

             <Box sx={{
                 width:'400px',
                 height:'100%',
                 border:"1px solid blue",
                 position:'absolute',
                 zIndex:2,
                 background:'#FFFFFF',
                 right:30}}>


             </Box>

        </Box>
    )

}
export default Signin
